import React, { useState } from "react";

interface ButtonProps {
  onClick?: () => void;
  label: string;
}



const Button: React.FC<{ onClick: () => void; label: string }> = (props) =>{
    const [count, setCount] = useState(0);
    return <div>
        <button onClick={() => {
            setCount(count + 1);
        }}>{props.label} - Clicked {count} times</button>
    </div>
}

export default Button;
